import data from './data';
import './css/Main.css';
import Card from './Card';
function Main(prop) {
    let cards = data.map(item => {
        return <Card
        {...item} />
    })
  return (
    <div className="cardContainer">
      {cards}
    </div>
  );
}

export default Main;
